import React, { useEffect, useState } from 'react';
import { useCookies } from 'react-cookie';
import LocalizedStrings from 'react-localization';
import Moment from 'moment';

import { View, useWindowDimensions } from 'react-native';
import { TopAppBarFixedAdjust } from '@material/react-top-app-bar';
import { DrawerAppContent } from '@material/react-drawer';
import { Cell, Grid, Row } from '@material/react-layout-grid';
import MaterialIcon from '@material/react-material-icon';
import '@material/react-layout-grid/dist/layout-grid.css';
import '@material/react-material-icon/dist/material-icon.css';

import MaterialTopAppBar from '../../components/horizontal-prototype/MaterialTopAppBar';
import MaterialDrawer from '../../components/horizontal-prototype/MaterialDrawer';
import MaterialFab from '../../components/horizontal-prototype/MaterialFab';
import MaterialSnackbar from '../../components/horizontal-prototype/MaterialSnackbar';
import InventoryCard from '../../components/horizontal-prototype/InventoryCard';
import InventoryConsumeDialog from '../../components/horizontal-prototype/InventoryConsumeDialog';
import InventoryDiscardDialog from '../../components/horizontal-prototype/InventoryDiscardDialog';

import { apiUrl } from '../../url';

const strings = new LocalizedStrings({
  en: {
    inventory: 'Inventory',
    view_log: 'View log',
    consume: 'Consume',
    discard: 'Discard',
    expiring: 'Expiring',
    expired: 'Expired',
    toast_missing: 'Oops. Information is missing.',
    toast_consumed: 'Item consumed from inventory.',
    toast_discarded: 'Item discarded from inventory.',
  },
});

export default () => {
  const [cookies, setCookie] = useCookies(['session', 'userID']);
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [dialogOpen, setDialogOpen] = useState(null);
  const [inventoryID, setInventoryID] = useState(null);
  const [dialogQuantity, setDialogQuantity] = useState(0.0);
  const [dialogUnit, setDialogUnit] = useState('');
  const [toast, setToast] = useState('');
  const [inventory, setInventory] = useState([]);

  const dummySetup = () => {
    // TODO: hard code inventory array
    setInventory([
      {
        key: 1,
        title: 'Apple',
        subtitle: '2 ct by user 1 \nstored 10 days ago \nexpiring in 2 days',
        image: 'data:image/png;base64,',
      },
      {
        key: 2,
        title: 'Milk',
        subtitle: '2 ct by user 1 \nstored 1 day ago \nexpiring in 21 days',
        image: 'data:image/png;base64,',
      },
    ]);
  };

  const load = async () => {
    await fetch(`${apiUrl}/v4/inventory/list/all?session=${cookies.session}`, {
      method: 'get',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    })
      .then((res) => {
        if (!res.ok) {
          if (res.status !== 406) {
            throw new Error(`${res.status} ${res.statusText}`);
          } else {
            return null;
          }
        }
        return res.json();
      })
      .then(async (data) => {
        if (data !== null) {
          let ingredientIDs = data.map((item) => item.ingredientID);
          if (ingredientIDs.length > 0) {
            ingredientIDs = [...new Set(ingredientIDs)];
            await fetch(`${apiUrl}/v4/ingredients?session=${cookies.session}&ingredientIDs=${ingredientIDs.join(',')}`, {
              method: 'get',
              headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json',
              },
            })
              .then((res2) => {
                if (!res2.ok) {
                  if (res2.status !== 406) {
                    throw new Error(`${res2.status} ${res2.statusText}`);
                  } else {
                    return null;
                  }
                }
                return res2.json();
              })
              .then((data2) => {
                if (data2 !== null) {
                  const inventory2 = data.map((item) => {
                    const ingredient = data2.find((item2) => item.ingredientID === item2.ingredientID);
                    return {
                      key: item.inventoryID,
                      title: ingredient.name,
                      subtitle: (() => {
                        let value = `${item.totalQuantity} ${item.unit}`;
                        if (item.expirationDate !== null) {
                          value += ' | ';
                          const expirationDate = Moment.utc(item.expirationDate);
                          if (expirationDate.unix() >= Moment.utc()) {
                            value += strings.expiring;
                          } else {
                            value += strings.expired;
                          }
                          value += ` ${expirationDate.fromNow()}`;
                        }
                        if (item.price) {
                          value += ` | $${item.price}`;
                        }
                        return value;
                      })(),
                      image: ingredient.image,
                    };
                  });
                  setInventory(inventory2);
                } else {
                  setToast(strings.toast_missing);
                }
              });
          } else {
            setToast(strings.toast_missing);
          }
        } else {
          setToast(strings.toast_missing);
        }
      })
      .catch((error) => setToast(error.toString()));
  };

  useEffect(() => {
    // dummySetup();
    load();
  }, []);

  const toggleDrawer = () => {
    setDrawerOpen(!drawerOpen);
  };

  const toggleDialog = (dialogOpen) => {
    setDialogOpen(dialogOpen);
  };

  const handleConsume = (key) => {
    setInventoryID(key);
    toggleDialog('consume');
  };

  const handleDiscard = (key) => {
    setInventoryID(key);
    toggleDialog('discard');
  };

  const handleSubmission = async (value) => {
    const action = dialogOpen;
    toggleDialog(null);
    if (value === 'confirm') {
      switch (action) {
        case 'consume':
        case 'discard':
          await fetch(`${apiUrl}/v4/inventory/${action}`, {
            method: 'post',
            headers: {
              Accept: 'application/json',
              'Content-Type': 'application/json',
            },
            body: JSON.stringify({
              session: cookies.session,
              userID: cookies.userID,
              inventoryID,
              quantity: dialogQuantity,
              unit: dialogUnit,
            }),
          })
            .then((res) => {
              if (!res.ok) {
                throw new Error(`${res.status} ${res.statusText}`);
              }
            })
            .catch((error) => setToast(error.toString()));
          switch (action) {
            case 'consume':
              setToast(strings.toast_consumed);
              break;
            case 'discard':
              setToast(strings.toast_discarded);
              break;
          }
          load();
          break;
      }
    }
  };

  return (
    <>
      <View className="drawer-container">
        <MaterialTopAppBar
          title={strings.inventory}
          onClick1={toggleDrawer}
          onClick2={() => window.location.href = 'search/'}
        />
        <TopAppBarFixedAdjust className="top-app-bar-fix-adjust">
          <MaterialDrawer
            open={drawerOpen}
            selectedIndex={0}
            onClose={toggleDrawer}
          />
          <DrawerAppContent className="drawer-app-content">
            <Grid style={{ height: useWindowDimensions().height - 64 }}>
              {inventory.length > 0 && (
                <Row>
                  {inventory.map((item) => (
                    <Cell desktopColumns={6} phoneColumns={4} tabletColumns={4}>
                      <InventoryCard
                        mainText1={item.title}
                        mainText2={item.subtitle}
                        actionText1={strings.consume}
                        actionText2={strings.discard}
                        onClickMain={() => { window.location.href = `view/?id=${item.key}`; }}
                        onClickAction1={() => handleConsume(item.key)}
                        onClickAction2={() => handleDiscard(item.key)}
                        mainImage={item.image}
                      />
                    </Cell>
                  ))}
                </Row>
              )}
            </Grid>
          </DrawerAppContent>
          {toast && (
            <MaterialSnackbar message={toast} onClose={() => setToast('')} />
          )}
          <MaterialFab
            icon={<MaterialIcon icon="library_add" />}
            style={{ position: 'absolute', right: 16, bottom: 16 }}
            onClick={() => window.location.href = 'add/'}
          />
        </TopAppBarFixedAdjust>
      </View>
      <InventoryConsumeDialog
        open={dialogOpen === 'consume'}
        quantity={dialogQuantity}
        unit={dialogUnit}
        onChange1={(e) => setDialogQuantity(e.target.value)}
        onChange2={(e) => setDialogUnit(e.target.value)}
        onTrailingIconSelect1={() => setDialogQuantity(1.0)}
        onTrailingIconSelect2={() => setDialogUnit('')}
        onClose={handleSubmission}
      />
      <InventoryDiscardDialog
        open={dialogOpen === 'discard'}
        quantity={dialogQuantity}
        unit={dialogUnit}
        onChange1={(e) => setDialogQuantity(e.target.value)}
        onChange2={(e) => setDialogUnit(e.target.value)}
        onTrailingIconSelect1={() => setDialogQuantity(1.0)}
        onTrailingIconSelect2={() => setDialogUnit('')}
        onClose={handleSubmission}
      />
    </>
  );
};
